INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40000, 0, "", "", 1, 36, 0, 100);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107501, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", "ぺコリーヌ", 1, 37, 1, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107601, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", "コッコロ", 2, 38, 1, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107801, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", "キャル", 3, 39, 1, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107701, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", "スズメ", 4, 40, 1, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107901, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", "タマキ", 5, 41, 1, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107501, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", "ぺコリーヌ", 6, 42, 2, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107601, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", "コッコロ", 7, 43, 2, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107801, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", "キャル", 8, 44, 2, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107701, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", "スズメ", 9, 45, 2, 150);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (8, 91002, 0, 40001, 107901, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", "タマキ", 10, 46, 2, 150);
