INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 24001, 0, 40011, 125801, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 1, 321, 1, 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 24001, 0, 40011, 126001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 2, 322, 1, 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 24001, 0, 40011, 126101, "んーと。\nこれ、あげる。\nはい", "プレシア", 3, 323, 1, 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 24001, 0, 40011, 125801, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 4, 324, 2, 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 24001, 0, 40011, 126001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 5, 325, 2, 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 24001, 0, 40011, 126101, "お兄。\nきてくれて、うれしい", "プレシア", 6, 326, 2, 1);
